  false,\n\t\"url\": null,\n\t\"notes\": \"The Concord AOI consists of one area. Ground
  Control is collected throughout the AOI for use in the processing of LiDAR data
  to ensure data accurately represents the ground surface. QA/QC checkpoints, (FVA
  and CVA - see Ground Control process step for further information) also collected
  throughout the AOI, are used for independent quality checks of the processed LiDAR
  data. LiDAR acquisition products include Pre- and Post- flight reports which contain
  information on the flightlines, equipment parameters, and other pertinant acquisition
  details. The LiDAR product is considered to be point cloud data and consists of
  1500mx1500m tiles of LAS points which are partially classified such that the bare
  earth points can be calibrated to the ground surface and tested via the independent
  QC to ensure the ground surface is accurately represented. The Bare Earth deliverables
  consists of tiles of fully classified LAS points. A suite of products derived from
  the LiDAR data including DEMs and contour data has been created to support H&H analysis
  within the Concord watershed. A full narrative accompanies this deliverable, as
  well as the independent QC report.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
